class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        s = sorted(s)
        t = sorted(t)
        max_string = s if len(s) > len(t) else t
        min_string = t if len(s) > len(t) else s
        diff = ""

        for i in range(len(min_string)):
            if max_string[i] != min_string[i]:
                diff = max_string[i]
                break
        if not diff:
            diff = max_string[-1]
        return diff


if __name__ == "__main__":
    s = ""
    t = ""
    s = Solution().findTheDifference(s, t)
    print(s)
